import Player from '../components/Player.js'

function Index() {
  return (
    <main>
      <img src="static/images/banner.png" alt="The Artefact" />
      <Player name="005_day.mp3" />
      <style jsx>{`
        AudioPlayer{
          background-color: red !important;
        }
      `}</style>
    </main>
  );
}

export default Index;
